import { useState } from 'react';
import './App.css';
import NameInput from './components/NameInput'

function App() {
  const [name, setName] = useState('');
  const [surname, setSurname] = useState('');

  return (
    <div className="App">
      <h1>Lesson5</h1>
      <NameInput name={name} setValue={setName} placeholder='Please enter your name'/>
      <NameInput surname={surname} setValue={setSurname} />
    </div>
  );
}

export default App;
